import React from 'react';
import { NavLink, Link } from 'react-router-dom';
// import { AppBar, Toolbar, IconButton, MenuIcon, Typography, Button } from '@material-ui/core';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
// import MenuIcon from '@material-ui/icons/Menu';

export const Navbar = () => {
  return (
    <div>
      <AppBar position="static" style={{'background-color': 'transparent'}}>
        <Toolbar>
          {/* <IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu"> */}
            {/* <MenuIcon /> */}
          {/* </IconButton> */}
          <Typography variant="h6" /*className={classes.title}*/>
            <NavLink to="/cups" style={{color: "black", margin: '0 20px'}}>Кружки</NavLink>
            <NavLink to="/t-shirts" style={{color: "black", margin: '0 20px'}}>Футболки</NavLink>
          </Typography>
        </Toolbar>
      </AppBar>
    </div>
    // <nav>
    // <div className="nav-wrapper blue darken-1" style={{ padding: '0 2rem' }}>
    // {/* <li className="hover hover-3"><NavLink to="/">Logo</NavLink></li> */ }
    // <span className="brand-logo">Logo</span>
    // <ul id="nav-mobile" className="right hide-on-med-and-down">
    // <li className="hover hover-3"><NavLink to="/cups">Кружки</NavLink></li>
    // <li className="hover hover-3"><NavLink to="/t-shirts">Футболки</NavLink></li>
    // <li className="hover hover-3"><NavLink to="/souvenirs">Сувениры</NavLink></li>
    // <li className="hover hover-3"><NavLink to="/create">Конструктор</NavLink></li>
    // </ul>
    // </div>
    // </nav>
  )
}
